import React, {components} from 'react';
//import logo from './logo.svg';
import './App.css';
import Greet from './components/Greet'; 
import Welocome from './components/Welcome';
class App extends components {
  render(){
    return(
      <div className = 'App'>
        <Greet/>
        <Welocome/>
      </div>
    );
  }
}
export default App;
